import { createGlobalStyle } from "styled-components";

export const ResetCSS = createGlobalStyle`

html {
  line-height: 1.15;
  -webkit-text-size-adjust: 100%;
  -webkit-tap-highlight-color: transparent;
}

body {
  marign: 0;
}


`
